import React from 'react'
import Particles from 'react-particles-js';

const options = {
  background: {
    color: {
      value: "#0d47a1",
    },
  },
  fpsLimit: 60,
    interactivity: {
    detectsOn: "canvas",
      events: {
      onClick: {
        enable: true,
          mode: "push",
      },
      onHover: {
        enable: true,
          mode: "repulse",
      },
      resize: true,
    },
    modes: {
      bubble: {
        distance: 400,
          duration: 2,
          opacity: 0.8,
          size: 40,
      },
      push: {
        quantity: 4,
      },
      repulse: {
        distance: 200,
          duration: 0.4,
      },
    },
  },
  particles: {
    "number": {
      "value": 80,
      "density": {
        "enable": true,
        "value_area": 800
      }
    },
    "color": {
      "value": "#ffffff"
    },
    "shape": {
      "type": "circle",
      "stroke": {
        "width": 0,
        "color": "#000000"
      },
      "polygon": {
        "nb_sides": 5
      },
      "image": {
        "src": "img/github.svg",
        "width": 100,
        "height": 100
      }
    },
    "opacity": {
      "value": 0.5,
      "random": false,
      "anim": {
        "enable": false,
        "speed": 1,
        "opacity_min": 0.1,
        "sync": false
      }
    },
    "size": {
      "value": 5,
      "random": true,
      "anim": {
        "enable": false,
        "speed": 40,
        "size_min": 0.1,
        "sync": false
      }
    },
    "line_linked": {
      "enable": true,
      "distance": 150,
      "color": "#ffffff",
      "opacity": 0.4,
      "width": 1
    },
    "move": {
      "enable": true,
      "speed": 6,
      "direction": "none",
      "random": false,
      "straight": false,
      "out_mode": "out",
      "attract": {
        "enable": false,
        "rotateX": 600,
        "rotateY": 1200
      }
    }
  },
  detectRetina: true,
}

const Home = () => {
  return (
    <div >
      <div className="particles">
        <Particles params={options}/>
      </div>
      <div className="home">
        <h1 className="display-2 ">Welcome to the GG_clone app</h1>
      </div>
    </div>
  )
}

export default Home
